class Project7:
	def find(self):
		digits_to_check = list()
		num_to_split = str()
		for i in range(0, 995):
			if "0" not in num_to_split[i:i+5]: #get rid of all nums with 0 in them.
				digits_to_check.append(num_to_split[i:i+5])
		true_digits_to_check = set(digits_to_check)
		largest_digits = 0
		for true_digit_to_check in true_digits_to_check:
			cur_num = int(true_digit_to_check[0:1])
			cur_num*=int(true_digit_to_check[1:2])
			cur_num*=int(true_digit_to_check[2:3])
			cur_num*=int(true_digit_to_check[3:4])
			cur_num*=int(true_digit_to_check[4:5])
			if cur_num > largest_digits:
				largest_digits = cur_num
				
		print(largest_digits)
